def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    subject = triples[0].subject
    clauses = []

    if triples[0].predicate in ["cityServed", "country", "capital"]:
        clauses.append(f"{subject} is located in {triples[0].object}")

    if triples[1].predicate == "elevationAboveTheSeaLevel":
        clauses.append(f"with an elevation of {triples[1].object} meters")

    if triples[2].predicate == "location":
        clauses.append(f"located in {triples[2].object}")

    if triples[3].predicate == "operatingOrganisation":
        clauses.append(f"operated by {triples[3].object}")

    if triples[4].predicate in ["runwayLength", "runwayName"]:
        clauses.append(f"with a runway {triples[4].predicate} of {triples[4].object}")

    if triples[5].predicate == "isPartOf":
        clauses.append(f"which is part of {triples[5].object}")

    if triples[6].predicate == "1stRunwayLengthFeet":
        clauses.append(f"with its first runway being {triples[6].object} feet long")

    if triples[7].predicate == "1stRunwaySurfaceType":
        clauses.append(f"with its first runway surface type being {triples[7].object}")

    if triples[8].predicate in ["3rdRunwayLengthFeet", "4thRunwayLengthFeet"]:
        clauses.append(f"and its {triples[8].predicate} being {triples[8].object} feet long")

    if triples[9].predicate in ["icaoLocationIdentifier", "locationIdentifier"]:
        clauses.append(f"with {triples[9].predicate} of {triples[9].object}")

    if triples[10].predicate == "elevationAboveTheSeaLevelInFeet":
        clauses.append(f"with an elevation of {triples[10].object} feet")

    if triples[11].predicate in ["iataLocationIdentifier", "nativeName"]:
        clauses.append(f"with {triples[11].predicate} of {triples[11].object}")

    if triples[12].predicate == "leaderParty":
        clauses.append(f"led by the {triples[12].object}")

    if triples[13].predicate == "language":
        clauses.append(f"where the official language is {triples[13].object}")

    if triples[14].predicate in ["owner", "largestCity"]:
        clauses.append(f"{triples[14].predicate} {triples[14].object}")

    if triples[15].predicate in ["4thRunwaySurfaceType", "regionServed"]:
        clauses.append(f"{triples[15].predicate} {triples[15].object}")

    sentence = f"{subject}, " + ", ".join(clauses) + "."
    return sentence

